import React from "react";
import { useParams } from "react-router-dom";
import { getItem } from "../libs/getItems";
import { getProduct } from "../libs/getItems";
import Model, { Features, Modelprez } from "../libs/productGallery";
import Title from "../libs/productGallery";

export default function ProductRender() {
  const id = useParams();
  const data = getItem(id._id);
  const model = getItem(id._id).modele;
  console.log(data);

  return (
    <div className="container__head">
      <div className="container__head--title">
        <h1>{data.title}</h1>
      </div>
      <Model data={model} id={id._id} />
      <Modelprez />
      <Features />
    </div>
  );
}

export function ModelRender() {
  const id = useParams();
  const dataModel = getProduct(id._id).modele;
  console.log(dataModel);
  return <div>bonjour {dataModel[0].name}</div>;
}
